import React from "react";
import { Link, useNavigate } from "react-router-dom";
import "./Navbar.css";

const Navbar = ({ isLoggedIn, setIsLoggedIn }) => {
  const navigate = useNavigate();

  const handleLogout = () => {
    setIsLoggedIn(false);
    navigate("/login");
  };

  return (
    <nav className="navbar">
      <div className="navbar-left">
        <div className="logo">
            <img src="/images/trident-tab-promo.jpg" alt="Logo" className="logo-img" />
        </div>
        {isLoggedIn && (
          <ul className="nav-links">
            <li><Link to="/home">Home</Link></li>
            <li><Link to="/display">Display <span>▼</span></Link></li>
            <li><Link to="/schedule">Schedule <span>▼</span></Link></li>
            <li><Link to="/admin">Admin <span>▼</span></Link></li>
            <li><Link to="/support">Support <span>▼</span></Link></li>
            <li><Link to="/contact">Contact</Link></li>
          </ul>
        )}
      </div>
      {isLoggedIn && (
        <button className="logout-button" onClick={handleLogout}>
          Logout
        </button>
      )}
    </nav>
  );
};

export default Navbar;
